import {Link} from "react-router-dom";

export default class Profile extends React.Component {
  render(){
    return (
      <div className="App">
        <form>
          <h1>Login</h1>
          <div className="form-group">
            <input type="email" id="email" palceholder="email"></input>

          </div>
        </form>
      </div>
     );
  }

}
